  return (
    <Card className="expense-item">
       <div>
        <ExpenseDate date={props.date} />
      </div>
      <div className="expense-item__amount">
        <h2>{amount}</h2>
      <div className="expense-item__points">{props.points}</div>
      </div>
    </Card>
  );
}

export default ExpenseItem;
